import React, {useState} from 'react'
import "./feed.css"
import Share from "../share/Share";
import Post from "../post/Post";
const Feed=()=> {
  const [posts, setPosts]=useState([]);

  return (
    <div className='feed'>
      <div className="feedWrapper">
        <Share/>
        <Post/>
      </div>
    </div>
  );
  
}

export default Feed;
